import Logo from '../../components/Logo';
import Header from '../../components/MainHeader';
import './ManageProfile.css';

export default function ManageProfile(){
  return(
    <section className='m_profile'>
      <header className='m_profile__header'>
        <Logo />
      </header>
    </section>
  )
}
